script: |
  super -f text -I q9050.spq | sort > q9050.out

inputs:
  - name: q9050.spq
    data: |
      SELECT 92 + + - col2 - - + CAST ( NULL AS INTEGER ) + + + col0 / + - 64 * + col1 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT + col1 IS NOT NULL;
  - name: tab1

outputs:
  - name: q9050.out
    data: |
